import React, {StrictMode} from "react";
import {LayoutTags} from "../../layout";

let Header = LayoutTags.TagHeader();
let Footer = LayoutTags.TagFooter();
export function HomePage(){
    return(
        <StrictMode>
            <Header/>
            <h1>Hola Mundo</h1>
            <Footer/>
        </StrictMode>
    )
}
